class Shop extends Component
{

    render() {
        const {login, setClearLogin, path, basketSum, basketAdd, basketAmount, setUserPanelStep} = this.props;
        return (
            <>
                <Header login={login}
                        setClearLogin={setClearLogin}
                        path={path}
                        basketSum={basketSum}
                        basketAmount={basketAmount}
                        setUserPanelStep={setUserPanelStep}/>
                <Products basketAdd={basketAdd}
                          basket={basket}/>
                <Info/>
                <Footer/>
            </>
        )
    }
}

export default Shop;
